import React from "react";
import { Button, TextField, Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { Link } from "react-router-dom";
const useStyles = makeStyles({
  registerBlock: {
    textAlign: "center",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "85vh",
  },
  formBlock: {
    display: "flex",
    padding: "30px",
    width: "25%",
    flexDirection: "column",
    border: "1px solid black",
    borderRadius: "10px",
    backgroundColor: "#f2ffff",
  },
  inputField: {
    backgroundColor: "#fff",
    marginBottom: "20px",
  },
  loginBtn: {
    marginTop: "20px",
  },
  link: {
    color: "#3583d2",
  },
});
const RegisterPage = () => {
  const s = useStyles();
  return (
    <div className={s.registerBlock}>
      <form className={s.formBlock}>
        <TextField
          className={s.inputField}
          placeholder="Username"
          variant="outlined"
        />
        <TextField
          className={s.inputField}
          placeholder="Password"
          type="password"
          variant="outlined"
        />
        <TextField
          className={s.inputField}
          placeholder="E-Mail"
          variant="outlined"
        />
        <TextField
          className={s.inputField}
          placeholder="Phone"
          variant="outlined"
        />
        <Typography>
          Already have an account?{" "}
          <Link className={s.link} to="/auth">
            Log in!
          </Link>
        </Typography>
        <Button className={s.loginBtn} variant="contained" color="primary">
          Register
        </Button>
      </form>
    </div>
  );
};

export default RegisterPage;
